import { Link } from "react-router-dom";

const Navbar = props => (
  <div className="navigation">
    <Link to="/">About Me</Link>

    <Link to="/languages">Languages & Frameworks</Link>

    <Link to="/projects">My Projects</Link>
    {/* </li>
      <li> */}
    <Link>Contact Me</Link>
    {/* </li> */}
    {/* </ul> */}
  </div>
);

export default Navbar;
